```javascript
"use strict";

function f_gold(s) {
    let ans = 0, t = 0;
    let pos = Array(26).fill(-1);
    for (let i = 0; i < s.length; i++) {
        let c = s.charCodeAt(i) - 'a'.charCodeAt(0);
        t += i - pos[c];
        ans += t;
        pos[c] = i;
    }
    return ans;
}
